import React from 'react';
import API from './utils/API';

function EmployeeCard() {
    API.search()
      .then(res => {
        console.log("Res:" +JSON.stringify(res));
        return res;
      })
      .catch(err => console.log(err));

      return
  }

  export default EmployeeCard;
